import React from 'react';
import Navbar from './components/login/Navbar';
import "./App.scss";
import Apps from './Apps';
import {BrowserRouter,Route} from 'react-router-dom'
function App(){
  return (
    <BrowserRouter>
    <Navbar/>
    <Route path="/">
    </Route>
    <Apps/>
    </BrowserRouter>
  )
}

export default App;
